import Header from './Header';
import styled from 'styled-components';

const LayoutWrapper = styled.div`
  margin: 20;
  padding: 20;
  // border: '1px solid #DDD
`;

const Layout = props => (
  <LayoutWrapper>
    <Header />
    {props.children}
  </LayoutWrapper>
);

export default Layout;
